import React, { Component } from 'react';
import { Container, Typography, Grid } from "@material-ui/core";
import { Field, reduxForm } from "redux-form";

class Login extends Component {
    render() {
        return (
            <Container component="main" maxWidth="xs">
                <Grid item xs={12}>
                    <Typography className="form-title" component="h1" variant="h5">Sign in</Typography>
                    <form className="form-custom" onSubmit={this.props.handleSubmit(this.onSubmit)} noValidate>
                        <Field className="form-control" label="Please enter the email" name="email" component={this.inputRender}></Field>
                    </form>
                </Grid>
            </Container>
        );
    }
}

export default reduxForm({
    form: 'login',
})(Login);
